.:Description:.
Co-produced by Wicked Pictures and Adam &amp; Eve, Stormy Daniels' epic western saga Wanted is set in 1879 in Diablo City, Arizona - a hard town full of hard people. The suspicious death of wealthy landowner Frank Garrett triggers a chain of events, which brings gunfire and bloodshed to the streets of Diablo City. Garrett's left behind a valuable secret, and everyone wants to discover it.
